import React from 'react'

export default function Dashboard() {
    const MostrarDatos = () => {
        Axios.post('http://localhost:4000/add-evaluacion-1',).then((response) => {
            setData(response.data);
        });
    }
    return (
        <div>
            <h1>Este es tu Dashboard</h1>
        </div>
    )
}
